import React, {Component} from "react";

import Navbar from "./mutual-components/Navbar";

class App extends Component{

    constructor(props) {
        super(props);
        this.state = {
            wmk:"women"
        }
    }

    render(){
        return(<>
            <Navbar/>
            <p>{this.state.wmk}</p>
            </>)
    }
}

export default App;
